model: array-google
destination: s3-test-bucket
config:
  mode: diff
  fileType: csv
  mappings: []
  delimiter: ','
  skipEmpty: true
  configVersion: 1
  diffAddedPath: results-added.csv
  includeHeader: true
  autoSyncColumns: true
  csvRowDelimeter: auto
  diffChangedPath: results-changed.csv
  diffRemovedPath: results-removed.csv
  timestampOffsetSeconds: 0
schedule:
  type: manual
schedulePaused: true
